import { Component } from '@angular/core';
import { FormControl } from '@angular/forms';

@Component({
  selector: 'app-add-feedback',
  templateUrl: './add-feedback.component.html',
  styleUrls: ['./add-feedback.component.scss']
})
export class AddFeedbackComponent {
name=new FormControl('');
email=new FormControl('');
Telephone=new FormControl('');
Comments=new FormControl('');
}

<form action="/home">
    <div id="parent">
    <div class="wrapper">
    <div class="mb-3">
        <label for="pwd" class="form-label">Name:</label>
        <input type="name" class="form-control" id="pwd" placeholder="Enter name"  [formControl]="name">
      </div>
    <div class="mb-3 mt-3">
      <label for="email" class="form-label">Email:</label>
      <input type="email" class="form-control" id="email" placeholder="Enter email" name="email" [formControl]="email">
    </div>
    <div class="mb-3">
        <label for="comment">Comments:</label>
         <textarea class="form-control" rows="5" id="comment" name="text" [formControl]="Comments"></textarea>
    </div>
    <div class="mb-3">
        <label for="comment">Telephone:</label>
         <input type="tel" class="form-control" id="Telephone" placeholder="Enter Telephone" name="Telephone" [formControl]="Telephone">
    </div>

    <button type="submit" class="btn btn-ligth">send</button>
</div>
</div>
  </form>
